import useState from 'react';

import List from './List';
import Form from './Form';

const Todo = () => {
  const todoList = [
    {
      id: 1,
      content: '店予約する',
    },
    {
      id: 2,
      content: '卵買う',
    },
    {
      id: 3,
      content: '郵便出す',
    },
  ];

  const [todo, settodo] = useState(todoList);

  return (
    <div>
      <h2>Remainder</h2>
      <List todoList={todoList} />
      <Form />
    </div>
  );
};

export default Todo;
